class Solution {
    func numDistinct(_ s: String, _ t: String) -> Int {
        let sArr = Array(s), tArr = Array(t)
        var memo = [[Double]](repeating: [Double](repeating: 0, count: sArr.count + 1), count: tArr.count + 1)
        for i in 0..<s.count { memo[0][i] = 1 }
        for tIdx in 0..<t.count {
            for sIdx in 0..<s.count {
                if tArr[tIdx] == sArr[sIdx] {
                    memo[tIdx + 1][sIdx + 1] = memo[tIdx][sIdx] + memo[tIdx + 1][sIdx]
                } else {
                    memo[tIdx + 1][sIdx + 1] = memo[tIdx + 1][sIdx]
                }
            }
        }
        return Int(memo[t.count][s.count])
    }
}
var s = "", t = ""
print(Solution().numDistinct(s, t))
